          Here is your eStatement for
             September 2025
          
          
          
        
          
          
          
        
      
      
    

	
		
		  
		    
		      
		        
		        Dear VIMLESH BAHUGUNA
		          
		          Thank you for choosing eStatements.
		          
		          Please find attached your ICICI Bank Credit Card eStatement for September 2025.
		          
		          Your eStatement is in Adobe Acrobat Portable Document Format (PDF). You need Adobe Acrobat Reader to view the attached file. If you do not have Adobe Acrobat Reader, please click here to download for free.
		          
		          Your SMART STATEMENT is now just a CLICK AWAY!! 
Enjoy a seamless experience with ONE VIEW STATEMENT and revolutionize the way you manage and interact with your credit card statement. Click here to access your Smart Statement
		          
		        
	          
		      
		    
		      
		        
		        
		          
		            How to view your PDF statement
		            
		          
		            
		            
		          
		        
	          
		      
		        
		        
		          
		            
		              
		                
		                
		              
		                &nbsp;
		                
		              
		            &nbsp;
		            The first four letters of your password are the first four letters of your name as displayed on your Credit Card, followed by your date and month of birth (in DDMM format).
		            
		          
		            
		            
		            
		            
		          
		            
		              
		                
		                
		              
		                &nbsp;
		                
		              
		            &nbsp;
		            The password is case sensitive (lowercase). Please do not include any special characters or spaces.
		            
		          
		            
		            
		            
		            
		          
		            
		              
		                
		                
		              
		                &nbsp;
		                
		              
		            &nbsp;
		            For example, if the name on your Credit Card is Sujit Sawant and your date of birth is January 05, 1950, then your password will be suji0501.
		            
		          
		        
	          
		      
	      
	    
  
	
		
          
            
            
              
                
                
              
              
                
                  
                    There are multiple ways by which you can pay your Credit Card bills.
                  
                  
                    
                      
                        
                        
                        
                        
                      
                      
                        
                        &nbsp;
                        Pay online from your ICICI Bank Account
                        &nbsp;
                      
                      
                        
                        
                        
                        
                      
                      
                        
                        &nbsp;
                        Use Scan to Pay for making QR-Code based Unified Payments Interface (UPI) payments 
                        &nbsp;
                      
                      
                        
                        
                        
                        
                      
                      
                        
                        &nbsp;
                        Make UPI payment through any UPI-enabled app/ Bharat Interface for Money (BHIM)  app to ICICI Bank Virtual Payment Address  (VPA): ccpay.&lt;10digits Registered Mobile number&gt; &lt;last 4 digits of credit card&gt;@icici
                        &nbsp;
                      
                      
                        
                        
                        
                        
                      
                      
                        
                        
                        National Electronic  Funds Transfer (NEFT): Pay from your other bank Internet  Banking facility, if they have the NEFT facility. Use your 16-digit  Visa Credit Card number and Indian  Financial System (IFS) Code ICIC0000103 for ICICI Bank at the time of registration of ICICI Bank Credit  Card as the payee for fund transfer.
                        
                      
                      
                        
                        
                        
                        
                      
                      
                        
                        &nbsp;
                        Pay by signing up for Auto Debit 
                        &nbsp;
                      
                      
                        
                        
                        
                        
                      
                      
                        
                        &nbsp;
                        Pay by cheque at the common drop box / mail it to us
                        &nbsp;
                      
                      
                        
                        
                        
                        
                      
                      
                        
                        &nbsp;
                        Pay by using the Pay@ATM facility
                        &nbsp;
                      
                      
                        
                        
                        
                        
                      
                      
                        
                        &nbsp;
                        Pay by cheque at an ICICI Bank branch
                        &nbsp;
                      
                      
                        
                        
                        
                        
                      
                      
                        
                        &nbsp;
                        Pay from your ICICI Bank Account using iMobile app 
                        &nbsp;
                      
                      
                        &nbsp;
                        &nbsp;
                        &nbsp;
                        &nbsp;
                      
                    
                  
                
                &nbsp;
              
              
                
                  
                    &nbsp;
                  
                  
                    Quick links
                  
                  
                    
                      
                        
                        Cardholder Terms and Conditions . Customer Care . Nearest ATM
                        
                      
                    
                  
                  
                    &nbsp;
                  
                  
                    Looking forward to more opportunities to be of service to you.

Sincerely, 
ICICI Bank Credit Cards Team

                  
                  
                    &nbsp;
                  
                
                
              
            
            
              
                
              
              
                
                  
                    
                    
                  
                  
                    
                    
                  
                  
                    &nbsp;
                    
                  
                
              
            
          
      
  
	
		
			
  
	
	   Please add our e-mail ID - credit_cards@icicibank.com to your address book by clicking here to ensure that our mails always reach your inbox. 
	    
	    Please click here to read the Most Important Terms and Conditions.
	    
	    If the card member fails to pay the Minimum Amount Due by the date indicated in the billing statement, it shall be treated as a default. In case of default, the Bank can forward the Default report to the Credit Information Bureaus or to such other agencies as approved by law. The time period between the payment due date and the billing date indicated on the billing statement is considered as the notice period for reporting a Card Member as a defaulter. For any clarification or more information, you may call our Customer Care.
	    
	    Confidentiality information and Disclaimer
	    This e-mail message and its attachments may contain confidential, proprietary or legally privileged information and is intended solely for the use of the individual or entity to whom it is addressed. If you have erroneously received this message, please delete it immediately and notify the sender. If you are not the intended recipient of the e-mail, you should not disseminate, distribute or copy this e-mail. E-mail transmission cannot be guaranteed to be secure or error-free as information could be intercepted, corrupted, lost, destroyed, be incomplete or contain viruses and ICICI Bank accepts no liability for any damage caused by the limitations of e-mail transmission.

